  false,\n\t\"url\": null,\n\t\"notes\": \"Current 511 Events for Nebraska. This layer
  is updated every 10 minutes. This layer is provided as a courtesy from Iowa DOT
  for use by Iowa DOT web mapping applications. Iowa DOT does not take responsibility
  for its accuracy or completeness. Please visit Nebraska 511 for up-to-date conditions:
  http://www.511.nebraska.gov/rnrnNote: This is an Esri Feature Collection which is
  different than an Esri Feature Service. Feature Collections allow for high-availability.
  There are unique characteristics that need to be considered when using this data
  type: rnIt is a file-based data type so there is no REST endpoint. However, there
  is JSON that can be parsed out. See link at the bottom of this page.rnYou cannot
  set a refresh interval in the map document, you must use the Info Summary Widget
  inside an application or hard-code the refresh in a custom application.rnThe rotation
